import ItemHeader from "../ItemHeader/ItemHeader";
import "./header.css";
const inicio = "Inicio";
const consulta = "Consulta";

const Header = () => {
  return (
    <>
      <div className="headerContainer">
        <ItemHeader name={inicio} />
        <ItemHeader name={consulta} />
      </div>
    </>
  );
};

export default Header;
